// SPDX-License-Identifier: MIT
pragma solidity ^0.8.2;

contract DodoCoin {
    // State variables
    string public name = "DodoCoin";
    string public symbol = "DODO";
    uint8 public decimals = 18;
    uint256 public totalSupply;
    mapping(address => uint256) public balanceOf;
    mapping(address => mapping(address => uint256)) public allowance;

    // Events
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
    event Debug(string message, address indexed account, uint256 value);
    // Constructor
    constructor(uint256 initialSupply) {
        totalSupply = initialSupply * (10 ** uint256(decimals));
        balanceOf[msg.sender] = totalSupply;
        emit Transfer(address(0), msg.sender, totalSupply);
    }

    // Transfer function
    function transfer(address recipient, uint256 amount) external returns (bool) {
        require(balanceOf[msg.sender] >= amount, "Insufficient balance");
        balanceOf[msg.sender] -= amount;
        balanceOf[recipient] += amount;
        emit Transfer(msg.sender, recipient, amount);
        return true;
    }

    // Approve function
    function approve(address spender, uint256 amount) external returns (bool) {
        allowance[msg.sender][spender] = amount;
        emit Approval(msg.sender, spender, amount);
        return true;
    }

    // TransferFrom function
    function transferFrom(address sender, address recipient, uint256 amount) public returns (bool) {
        require(balanceOf[sender] >= amount, "Insufficient balance");
        require(allowance[sender][msg.sender] >= amount, "Allowance exceeded");

        emit Debug("Sender balance before", sender, balanceOf[sender]);
        emit Debug("Recipient balance before", recipient, balanceOf[recipient]);
        emit Debug("Allowance before", sender, allowance[sender][msg.sender]);

        balanceOf[sender] -= amount;
        balanceOf[recipient] += amount;
        allowance[sender][msg.sender] -= amount;

        emit Debug("Sender balance after", sender, balanceOf[sender]);
        emit Debug("Recipient balance after", recipient, balanceOf[recipient]);
        emit Debug("Allowance after", sender, allowance[sender][msg.sender]);

        emit Transfer(sender, recipient, amount);
        return true;
    }

    // Mint function
    function mint(address to, uint256 amount) external {
        uint256 amountWithDecimals = amount * (10 ** uint256(decimals));
        totalSupply += amountWithDecimals;
        balanceOf[to] += amountWithDecimals;
        emit Transfer(address(0), to, amountWithDecimals);
    }

    // Burn function
    function burn(uint256 amount) external {
        uint256 amountWithDecimals = amount * (10 ** uint256(decimals));
        require(balanceOf[msg.sender] >= amountWithDecimals, "Insufficient balance to burn");
        balanceOf[msg.sender] -= amountWithDecimals;
        totalSupply -= amountWithDecimals;
        emit Transfer(msg.sender, address(0), amountWithDecimals);
    }
}
